import (
	context "context"
	fern "github.com/pagination-custom/fern"
	fernclient "github.com/pagination-custom/fern/client"
	option "github.com/pagination-custom/fern/option"
)

client := fernclient.NewClient(
	option.WithToken(
		"<YOUR_AUTH_TOKEN>",
	),
)
response, err := client.Users.ListUsernamesCustom(
	context.TODO(),
	&fern.ListUsernamesRequestCustom{
		StartingAfter: fern.String(
			"starting_after",
		),
	},
)
